INSERT INTO `v1_7aa91231e64621454eb26b9af78dd0162f651c31fde6cf772c6f20cab0ae5466` VALUES (1, "プレミアムコレクションではサイン色紙や\nブロマイドなど、★★以上のグッズが盛りだくさん！\nレアグッズをたくさんゲットしよう！", 10, "プレミアムコレクション", "1回メダル{0}枚！\nメンバー直筆サイン色紙など、★★以上のグッズを確定でゲット！", 2);
